script: |
  super -f text -I q13326.spq | sort > q13326.out

inputs:
  - name: q13326.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE ( - 38 NOT IN ( + col1 / + - 46 * - col2 * 24 + + 31 * 20, + col0 * + - col2 ) );
  - name: tab2

outputs:
  - name: q13326.out
    data: |
      46	51	23
      64	77	40
      75	67	58
